import styled, {keyframes}from 'styled-components/macro';

export const Container = styled.div`
    width: 100%;
    height: 100%;
    position: flex;
    align-item: center;
    justify-content: center;
`;

export const PicCon = styled.div`
    position: flex;
    width: 400px;
    height: 3000px;
    aligned-item: center;
    justify content: center;
`;

export const PicLeft = styled.img`
  position: absolute;
  right: -20px;
  top: -40px;
  width: 50%;
  height: 50%;
`;

export const PicRight = styled.img`
    position: absolute;
    left: -20px;
    bottom: -40px;
    width: 50%;
    height: 50%;
`;
